import {  makeStyles } from "@material-ui/core";
import React from "react";

const useStyles = makeStyles({
  root:{
    width:"100%",
    height:400,
    margin: "150px 0 0 0 ",
    backgroundColor:"red"
  },
})

export default function Home() {
  const classes = useStyles()
  return <div className={classes.root}>Home</div>;
}
